    type: "rectangle",
    fillStyle: { 
        type: "linearGradient",
        startPosition: io.mouse.position,
        endPosition: [0, 0],
        colorStops: [{
            position: memory.colorStop, 
            color: transformers.makeRgbaColorCode(memory.color1, memory.color2, memory.color3, memory.color4)
        },
        {
            position: 1-memory.colorStop, 
            color: transformers.makeRgbaColorCode(memory.color2, memory.color3, memory.color1, memory.color4)
        }]
    },
    position: [0, 0],
    size: io.canvas.size
}]

updateBall.body:
ball = RW.cloneData(ball);

if(ball.position[0] < 0){
    ball.position[0] = 0;
    ball.speed[0] = -ball.speed[0];
}else if(ball.position[0] > screenSize[0]){
    ball.position[0] = screenSize[0];
    ball.speed[0] = -ball.speed[0];
}else{
    ball.position[0] += ball.speed[0];
}

if(ball.position[1] < 0){
    ball.position[1] = 0;
    ball.speed[1] = -ball.speed[1];
}else if(ball.position[1] > screenSize[1]){
    ball.position[1] = screenSize[1];
    ball.speed[1] = -ball.speed[1];
}else{
    ball.position[1] += ball.speed[1];
}

return ball;
